import React from "react";
import Slide from "react-reveal/Slide";

function Heading() {
  return (
    <>
      <Slide top>
        <div id="Heading">
          <h1>Java Project Management App</h1>
          <h3>Made by realazaber</h3>
        </div>
      </Slide>
      <hr />
    </>
  );
}

export default Heading;
